description:
THE ALEX JONES SHOW
2009.05.21 Thursday

Alex talks with retired professional wrestler, Navy UDT veteran, actor, former radio and television talk show host and Minnesota Governor Jesse Ventura. Alex also welcomes to the show Rand Paul, son of Dr. Ron Paul, and long-time Chairman of the Kentucky Taxpayers Association. Alex also welcomes to the show Darrel Rundus, Christian businessman and founder of The Great News Network, an international Christian evangelism ministry. Alex covers the latest news and takes your calls. 

HR 1: News, RAND PAUL 
HR 2: More Rand Paul, Bilderberg review, Midas, AJ on Austin News, calls
HR 3: Open lines, DARRELL RUNDUS, open lines w/Darrell
HR 4: Open lines, JESSE VENTURA (extended interview)


